import {useState} from 'react';
import './App.css';
import Searchbar from './components/searchbar/searchbar';



function App() {
  const [id , setid] = useState("")
  function getuserid(value : any){
      setid(value)
  }
  return (
    <div className="App">
      <Searchbar id = {getuserid}/>
      <h1>id</h1>
    </div>
  );
}

export default App;
